import React from 'react';
import Button from './button';
import PageTitle from './PageTitle';
import formatTimeTo12Hour from '../utilities/formatTimeTo12Hour';
import { useBooking } from './bookingContext';

function BookingComplete() {
  const {time} = useBooking(); // Access context values and setStep from context

  const timeDisplay = formatTimeTo12Hour(time);

  return (
    <div>
      <PageTitle titleText={"Table Reserved!"}/>
      <div className='reservation-background center-items'>
        <h2>Your table for {timeDisplay} has been set!</h2>
        <Button buttonText={'Return To Homepage'} buttonClass={'button-yellow'} link={"/"} />
      </div>
    </div>
  );
}

export default BookingComplete;
